import React from 'react';

const NextPrevious = (nexprev, nextButton) => {
    console.log("nexprev: " + nexprev.nexprev);
    if (nexprev !== null) {
        return(
        <button onClick={nextButton.nextButton}>Next</button>
        );
    } else {
        return (<p></p>);
    }
};

export default NextPrevious;
